ws about future plans for Beaver Builder and an upcoming module overhaul! Our plugs and footnotes section is well stocked this time around. We've been jumping on a ton of podcasts recently talking about everything from the future of\u00a0Beaver Builder to digital nomadism! Let's get into it\u2026<\/p>\n","protected":false},"template":"","meta":{"_fl_notification":["https:\/\/www.wpbeaverbuilder.com\/winter-update-blocks-future-plans-and-more\/"]},"_links":{"self":[{"href":"https:\/\/www.wpbeaverbuilder.com\/wp-json\/wp\/v2\/fl_notification\/430933"}],"collection":[{"href":"https:\/\/www.wpbeaverbuilder.com\/wp-json\/wp\/v2\/fl_notification"}],"about":[{"href":"https:\/\/www.wpbeaverbuilder.com\/wp-json\/wp\/v2\/types\/fl_notification"}],"wp:attachment":[{"href":"https:\/\/www.wpbeaverbuilder.com\/wp-json\/wp\/v2\/media?parent=430933"}],"curies":[{"name":"wp","href":"https:\/\/api.w.org\/{rel}","templated":true}]}},{"id":423877,"date":"2019-01-16T15:51:14","date_gmt":"2019-01-16T23:51:14","guid":{"rendered":"https:\/\/www.wpbeaverbuilder.com\/?post_type=fl_notification&#038;p=423877"},"modified":"2019-01-16T15:51:14","modified_gmt":"2019-01-16T23:51:14","slug":"difference-between-gutenberg-and-page-builders-like-beaver-builder-elementor-and-divi","status":"publish","type":"fl_notification","link":"https:\/\/www.wpbeaverbuilder.com\/?fl_notification=difference-between-gutenberg-and-page-builders-like-beaver-builder-elementor-and-divi","title":{"rendered":"Difference between Gutenberg and Page Builders like Beaver Builder, Elementor, and Divi"},"content":{"rendered":"<p><img class=\"aligncenter size-full wp-image-423885\" src=\"https:\/\/www.wpbeaverbuilder.com\/wp-content\/uploads\/2019\/01\/gutenberg-vs-bb-notification.jpg\" alt=\"Difference between Gutenberg and Beaver Builder\" width=\"318\" height=\"139\" srcset=\"https:\/\/www.wpbeaverbuilder.com\/wp-content\/uploads\/2019\/01\/gutenberg-vs-bb-notification.jpg 318w, https:\/\/www.wpbeaverbuilder.com\/wp-content\/